import { useState } from "react";

export default function RequestForm() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    requestType: "",
    quantity: "",
    modelNumber: "",
    salesOrder: "",
    description: "",
    file: null,
  });

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Handle file selection
  const handleFileChange = (e) => {
    setFormData({ ...formData, file: e.target.files[0] });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Simulate form submission (Replace with API call or backend logic)
    console.log("Submitted Data:", formData);
    alert("Request Submitted Successfully!");

    // Reset form fields after submission
    setFormData({
      name: "",
      email: "",
      requestType: "",
      quantity: "",
      modelNumber: "",
      salesOrder: "",
      description: "",
      file: null,
    });
  };

  return (
    <div className="container">
      <h1>Southwire Temporary Power Team Portal</h1>
      <form onSubmit={handleSubmit}>
        <label>Name:</label>
        <input type="text" name="name" value={formData.name} onChange={handleChange} required />

        <label>Email:</label>
        <input type="email" name="email" value={formData.email} onChange={handleChange} required />

        <label>Request Type:</label>
        <select name="requestType" value={formData.requestType} onChange={handleChange} required>
          <option value="">Select Request Type</option>
          <option value="Tool Request">Tool Request</option>
          <option value="Hardware Request">Hardware Request</option>
          <option value="Part Request">Part Request</option>
          <option value="Engineering Drawing Request">Engineering Drawing Request</option>
          <option value="Electrical Schematics Request">Electrical Schematics Request</option>
          <option value="Engineering Review Request">Engineering Review Request</option>
          <option value="Non-Conforming Material">Non-Conforming Material</option>
          <option value="BOM Request">BOM Request</option>
          <option value="Packaging Materials Request">Packaging Materials Request</option>
        </select>

        <label>Quantity (if applicable):</label>
        <input type="number" name="quantity" value={formData.quantity} onChange={handleChange} />

        <label>Model # (if applicable):</label>
        <input type="text" name="modelNumber" value={formData.modelNumber} onChange={handleChange} />

        <label>Sales Order # (if applicable):</label>
        <input type="text" name="salesOrder" value={formData.salesOrder} onChange={handleChange} />

        <label>Description:</label>
        <textarea name="description" value={formData.description} onChange={handleChange} required />

        <label>Attach File:</label>
        <input type="file" onChange={handleFileChange} />

        <button type="submit">Submit Request</button>
      </form>
    </div>
  );
}
